elem_dict.text:
.footer-social-icon-wrapper{
        display: flex;
        justify-content: center;
        margin-bottom: 20px;
    }
	.footer-social-icon-link-icon {
		color: #ffffff;
	}

	.footer-social-icon-link {
		display: inline-block;
		width: 35px;
		height: 35px;
		font-size: 21px;
		cursor: pointer;
		text-align: center;
		border: 2px solid #ffffff;
		border-radius: 50%;
		margin: 0 10px 0 0;
	}

	.footer-social-icon-link:hover.facebook{
		border-color: #3b5998;
	}
	.footer-social-icon-link:hover.facebook i{
	    color:#3b5998;
	}

	.footer-social-icon-link:hover.twitter{
		border-color: #00acee;
	}
	.footer-social-icon-link:hover.twitter i{
	    color: #00acee;
	}

	.footer-social-icon-link:hover.instagram{
		border-color: #fb3958;
	}
	.footer-social-icon-link:hover.instagram i{
		color: #fb3958;
	}

	.footer-social-icon-link:hover.youtube{
		border-color: #ff0000;
	}
	.footer-social-icon-link:hover.youtube i{
		color: #ff0000;
	}

